import React from "react";
import Header from "../Header";
import Space from "../Space";
import "./Board.css";

function Board() {
    return (
        <div>
            <Header />
            <Space />
            <div className="board">
                <h2>Kanban Project</h2>
            </div>
        </div>
    );
}

export default Board;
